import React from "react";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import About from "../parts/About";
import Header from "../parts/Header";

const Home = () => {
  return (
    <>
      <Navbar />
      <Header />
      <About />
      <Footer />
    </>
  );
};

export default Home;
